import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

// profile picture (find a default link)
// name and major
// message button
// if user is logged in provide and edit button and view messages button and items bought
// items for sale

class Profile extends Component {
  //   Welcome = props => {
  //     return <h1>Hello, {props.name}</h1>;
  //   };

  //   element = <Welcome name="Sara" />;
  render() {
    // element, document.getElementById("root");
    return (
      <div>
        <div className="Top">
          <header class="page-cover">
            <div class="text-center">
              <h2 class="h4 mt-2 mb-0">Name</h2>
              <p class="text-muted">Major</p>
              <button class="btn btn-primary" type="submit">
                Message
              </button>
              {/* <hr /> */}
            </div>
          </header>
        </div>
        <nav class="page-navs">
          <div class="nav-scroller">
            <div class="nav nav-center nav-tabs">
              <a href="">
                Active <span class="badge">4</span>
              </a>
              <a href="">Sold</a>
            </div>
          </div>
        </nav>
        <div className="Bottom"></div>
      </div>
    );
  }
}

export default Profile;
